import logo from "./logo.svg";
import "./App.css";
import Todo from "./components/Todo";
import Modal from "./components/Modal";
import Backdrop from "./components/Backdrop";

function App() {
  return (
    <div>
      <h1>Todo</h1>
      <Todo text="Learn React" />
      <Todo text="Master React" />
      <Todo text="Explore React" />
      <Modal />
      <Backdrop />
    </div>
  );
}

export default App;
